import './App.css';
import Header from './BTGlasses/Header';
import Tryglasses from './BTGlasses/Tryglasses';

function App() {
  return (
    <div className="App" style={{position: 'relative'}}>


       <div className='w-100 h-50' style={{position: 'relative'}}>
       <img src="./glassesImage/background.jpg"  className='img-fluid' style={{width:'100%'}}/> 
       <div className='w-100 h-100' style={{position: 'absolute', top: '0', left: '0', backgroundColor:'#000', opacity:0.5}}> </div>
       </div>

     <Header/>
     <Tryglasses/>

    </div>
  );
}

export default App;
